('1662','23','6019','Scott''s Hotel Binissalem',Null,'Eines der schönsten Boutique-Hotels in Mallorca','19075','Dieses familiengeführte Boutique-Hotel liegt inmitten des Weinanbaugebietes von Mallorca und wurde mehrmals von verschiedenen Reiseagenturen als eines der schönsten Boutique-Hotels Mallorcas ausgezeichnet. Das Dorf ist bekannt für seine prämierten Rotweine und dem beliebten Wochenmarkt. Das Hotel ist ein idealer Ausgangspunkt für Radsportbegeisterte, Wanderer und Golfer.\r\nDas sehr gepflegte Hotel bietet 6 Suiten und 12 Doppelzimmer, eine bepflanzte Patio-Terrasse, eine Bibliothek, Küche, Frühstücksraum und ein kleines Hallenbad. Das Anwesen aus dem Jahr 1783  steht unter Denkmalschutz  und wurde zwischen 1991 und 1995 saniert und zum 4 Sterne Hotel ausgebaut. ','19076','2700000','111','2011-11-07 16:39:42','110','2011-11-07 16:41:01',Null,'1154','1','569',1,'1','0',Null,Null,'auf Anfrage','19077',Null,'0','0','0',Null,'2015-09-25 12:37:44',1,'0',Null,Null,Null,Null,'5',0,1,1,'0','1','1',1,1,Null,'19078',Null,'19079',Null,'19080',Null,'19081',Null,'19082','0',0,'0');
